import React from 'react'
import GlobalStyle, { ActiveBtn } from './GlobalStyle'

const DefaultView = ({ children }) => {
    return (
        <div>
            <GlobalStyle />
            <div>header</div>
            <div>login-box</div>
            {children}
            <button>asdasd</button>
        </div>
    )
}

export default DefaultView;
